import React from 'react';
import { Box } from '@mui/material';

// A simple placeholder logo for Dompé - in a real app you would use an actual logo image
const Logo = () => {
  return (
    <Box
      sx={{
        width: 50,
        height: 50,
        borderRadius: '50%',
        background: 'linear-gradient(135deg, #0063a3 0%, #89c0e6 100%)',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        color: 'white',
        fontWeight: 'bold',
        fontSize: '1.5rem',
        boxShadow: '0 4px 8px rgba(0, 99, 163, 0.2)',
      }}
    >
      D
    </Box>
  );
};

export default Logo;
